class OrderRecived extends React.Component<any> {
  public render() {
    return (
      <>
        <Head>
          <title>Invoice - PickBazar</title>
        </Head>
        <OrderRecivedPage />
      </>
    );
  }
}

export default withApollo(OrderRecived);
